import React from "react";
import "./Home.css";
import { Menu } from "antd";

function Home() {
  return (
    <div>
      <Menu
        items={[
          { key: "home", label: "Home" },
          { key: "dashboard", label: "DashBoard" },
          { key: "users", label: "Users list" },
        ]}
        mode="horizontal"
      />
    </div>
  );
}

export default Home;
